import React from 'react';
import './mus-have-card.style.css';

const Card = ({property}) => {
    const {index, name, picture, price} = property;
    return (
        <div id={`card-${index}`} className="card">
            <img src={picture}/>
            <div className="details">
                <p>{name}</p>
                <p>{price}</p>
            </div>
        </div>
    )
}

export default Card;
